// Build a request string from mixed input shapes.
//
// Supported:
// 1) { json: { body: { ... } } }  -> joins non-empty values from body
// 2) { json: { chatInput: "..." } } -> uses chatInput (trimmed)

const values = items.flatMap((i) => {
  const j = i.json ?? {};
  const out = [];

  // New shape: explicit chat input
  if (typeof j.chatInput === "string" && j.chatInput.trim()) {
    out.push(j.chatInput.trim());
  }

  // Existing shape: merge of body values
  const body = j.body;
  if (body && typeof body === "object" && !Array.isArray(body)) {
    for (const v of Object.values(body)) {
      if (v !== "" && v !== null && v !== undefined) out.push(String(v));
    }
  }

  return out;
});

// Join all values into a single string
const request = values.join(" ").replace(/\s+/g, " ").trim();

// Output as a single string called "request"
return [{ json: { request } }];

